import React from "react";

function Contact() {
  return (
    <div className="page">
      <h1>Contact Us</h1>
      <p>We are here to help with account questions, ticket purchases, and more.</p>
      <p>Email: support@zottry.com</p>
      <p>Phone: +1 (800) 555-0199</p>
      <p>Live chat: Available 24/7 inside your Zottry account.</p>
    </div>
  );
}

export default Contact;
